window.loading=!1;window.loadDeveloper=async function(a){var b=await fetch(`/developers/${a}/popularity`);if(!b.ok)throw Error(`HTTP error! status: ${b.status}`);var c=await b.text();document.getElementById(a).textContent=c;document.getElementById(`${a}-head`).style.width=`${c}%`};window.loadAllDevelopers=async function(){if(!window.loading&&!document.hidden){window.loading=!0;try{await Promise.all([window.loadDeveloper('bryden'),window.loadDeveloper('luke')])}catch(e){console.error(e)}finally{window.loading=!1}}setTimeout(window.loadAllDevelopers,500)};window.voteDeveloper=async function(A,_){var B=await fetch(`/developers/${A}/popularity`,{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({vote:_})});if(!B.ok)throw Error(`HTTP error! status: ${B.status}`);await window.loadDeveloper(A)};_=window.loadAllDevelopers();
